const wait = (ms = 150) => new Promise((resolve) => setTimeout(resolve, ms));

const STORAGE_KEY_COURTS = 'mock_courts';

const loadExtraCourts = () => {
  try {
    const raw = localStorage.getItem(STORAGE_KEY_COURTS);
    if (!raw) return [];
    const parsed = JSON.parse(raw);
    return Array.isArray(parsed) ? parsed : [];
  } catch (err) {
    console.error('Failed to read extra courts', err);
    return [];
  }
};

// Mock endpoint used by the Sports page when the real API is unavailable or disabled.
// Returns only locally stored courts (added via admin panel). Defaults are ignored to reflect live data.
export const fetchMockFacilities = async () => {
  await wait();
  const extras = loadExtraCourts();
  return { data: extras, error: null };
};

export default fetchMockFacilities;
